import React from "react";

import colors from "../../config/colors";

export function IntroCard(props) {
  return (
    <div className="cardBox">
      <div className="iconBox">
        <img src={props.icon} className="icon" />
      </div>
      <div className="cardTitle">{props.title}</div>
      <div className="cardIntro">{props.intro}</div>
    </div>
  );
}

export function CategoryCard(props) {
  return (
    <div className="cardBox2">
      <div style={{ border: "1px solid black", justifyContent: "center" }}>
        <div className="cardTitle2">Shoes</div>
        <div className="cardIntro2">
          Lorem ipsum dolor sit amet consectetur adipisicing elit.
        </div>
        <div className="btn" style={{ border: "1px solid black" }}>
          Shop Now
        </div>
      </div>
    </div>
  );
}
